import React, { useCallback, useEffect } from "react";
import { useNavigate } from 'react-router-dom';
import { Helmet } from "react-helmet";
import { useLocation } from "react-router-dom";
import Footer from "./components/Footer";
import Navbar, { titleState } from "./components/Navbar";
import { getRooms, joinRoom } from "./components/API/RoomAPI";
import { roomState } from "./Room";
import InputUser, { popupState } from "./components/InputUser";
import { userState } from "./App";

const NotFound = () => {
    const navigate = useNavigate();
    const navigateToRoom = useCallback(() => navigate("/Room", { replace: true }), [navigate]);

    const TITLE = "Not Found"

    const location = useLocation();
    const path = location.pathname.substring(1)



    return(
        <div className="App">
            <Helmet>
                <title>{TITLE}</title>
            </Helmet>
            <Navbar />
            <div>Dieser Raum <code>{path}</code> existiert nicht mehr.</div>
            <Footer />
        </div>
    )
}

export default NotFound;
